package Numbers;

public class swapNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int x = 6;
		int y = 10;
		
		int t;
		
		t = x;
		x = y;
		y = t;
		
		System.out.println("X " +x);
		System.out.println("Y " +y);
		System.out.println("T " +t);
		

	}

}
